  \"charley-river-and-tributaries-alaska-a-wild-and-scenic-river-analysis-preliminary-draft\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Charley River, Alaska, and its principal
  tributaries possess values which qualify it for inclusion in the National Wild and
  Scenic Rivers System. The Charley River and its immediate environment fulfills the
  requirements of the Wild and Scenic Rivers Act, and meets the supplemental criteria
  established jointly by the Secretary of the Interior and the Secretary of Agriculture
  as published in Guidelines for Evaluating Wild, Scenic and Recreational River Areas
  Proposed for Inclusion in the National Wild and Scenic Rivers System Under Section
  2, Public Law 90-542, February 1970. The entire river and its immediate environment
  be classified as a wild river area and that, subject to existing valid rights, public
  minerals be withdrawn from location and entry under the U.S. mining laws and mineral
  leasing laws.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
